<ul>
<li>异常处理 —— 在 logback 中，Appender 中的异常不会被应用感知到，在 log4j2 中提供了一些异常处理机制。</li>
<li>性能提升 —— log4j2 比较 log4j 和 logback 都有很明显的性能提升。</li>
<li>自动重载配置 —— 参考 logback 的设置，提供自动刷新参数配置的功能。（我们在生产上可以动态修改日志级别而不需要重启应用）</li>
</ul>
